let text = " GG ";
async function getdata() {
  try{
  let response = await fetch('https://kontests.net/api/v1/all');
  let responseJson = await response.json();
  return responseJson;
  } catch(error) {
    console.log(error);
  };
}

function App() {
  const data = getdata();
  console.log(data);
  data.forEach( function(contest){
    text += contest.name + " ";
  }
  );
  return text;
}

export default App;
